  National Wildlife Refuge and North Platte National Wildlife Refuge outlines Refuge
  accomplishments for May of 1938. The report begins by summarizing the weather conditions
  during this period. Wildlife- including migratory birds, predators, rodents, and
  reptiles- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. Photographs are attached.\",\n\t\"license_title\":
